@Ambassador  @Recruit 

ğŸ’»GM friends! Something we have been hearing about for the past few months regarding the risks and dangers of AI is that millions of current jobs will be displaced in the future. This generates worry and uncertainty about disruptive technologies. However, just as AI is already capable of performing some office jobs better than people, I think the tone may be exaggerated about AI definitely replacing many jobs. Rather, the functions in many jobs would change.

ğŸŒŠ So, if we look at it from an impartial point of view, I believe that the benefits are immense in the application of AI algorithms to make many processes for thousands of jobs more efficient. My question to all of you would be, to what extent **could AI replace/occupy current jobs by 2030**, and what would be the new jobs that would emerge? A somewhat philosophical question, but I think it's an important topic in which we can discuss interesting things.

